import React from "react";


function SearchBar() {
  return(
    <div>
    <link rel="stylesheet" href="https://unpkg.com/tailwindcss@^2/dist/tailwind.min.css" />
    <link rel="stylesheet" href="https://cdn.jsdelivr.net/gh/alpinejs/alpine@v2.x.x/dist/alpine.min.js" />
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css" />
    <div class="py-20 h-screen bg-red-300 px-2">
    <div class="max-w-md mx-auto rounded-lg overflow-hidden md:max-w-xl">
        <div class="md:flex">
              <div class="w-full p-3">
                  <div class="relative"> <i class="absolute fa fa-search text-gray-400 top-5 left-4"></i> <input type="text" class="bg-white h-14 w-full px-12 rounded-lg focus:outline-none hover:cursor-pointer" placeHolder="What are you craving for?..." name="" /><span class="absolute top-4 right-5 border-l pl-4"><i class="fa fa-microphone text-gray-500 hover:text-green-500 hover:cursor-pointer"></i></span> </div>
                </div>
            </div>
        </div>
    </div>
  </div>
  )
}

export default SearchBar;
